import React from "react";
import "../Styles/Navbar.css";

function Navbar() {
  const shrinkNavbar = () => {
    if (window.scrollY > 20) {
      setNavbar(true);
    }
  };

  window.addEventListener("scroll", shrinkNavbar);
  return (
    <>
      <div className="nav-large">
        Welcome to gyansudha English School Websites
      </div>
    </>
  );
}

export default Navbar;
